import axios from "axios";

const getData = async (token, setToken, employees, setEmployees) => {
  try {
    const resp = await axios.post("http://cms.avertra.com/auth/local", {
      identifier: "Cms@avertra.com",
      password: "Avertra@2021",
    });
    console.log(typeof resp.data.jwt, "Data");
    setToken(resp.data.jwt  );
    // setToken()
  } catch (err) {
    console.error(err);
  }
};

export { getData };
